const img5="https://picsum.photos/220/300";
const links="https://www.google.com";




ReactDOM.render(
  [<h1  style={{
    color: "#fa9191",
    textTransform:"capitalize",
    textAlign: "center",

  }} >My name is {name}</h1>,
    <div className="newdiv">
    <img src={img1} alt=" not found!!"/>
    <img src={img2} alt=" not found!!"/>
    <a href={links}  target="_blank"><img src={img5} alt=" not found!!"/></a>
    </div>
 ],document.getElementById("root")

);
